             <h1>Nice Curves!</h1>
             <p>A website is like a road. The more curves it has the more interesting it is.</p>
          </section>
             {/* 
             <motion.button  
              whileHover={{ scale: 1.1 }}
              whileTap={{ scale: 0.9 }}
              className="indexBtn"
              onClick={fun}
            >
              Functions
            </motion.button>
